  Left,
  Information,
  InnerContainer,
  Right,
} from './HomePageElement';
import { LoginForm } from './components/Form';

const GreetingPage = (): JSX.Element => (
  <Container>
    <Bg />
    <InnerContainer>
      <Left>
        <Information>Join us and wreak havoc</Information>
